import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import CreateTopic from "./components/create-topic.component";
import EditTopic from "./components/edit-topic.component";
import TopicList from "./components/topic-list.component";

import logo from "./logo.png";

class App extends Component {
  render(){
    return (
      <Router>
          <div className="container">
            <nav className="navbar navbar-expand-lg navbar-light">
              <a class="navbar-brand" href="/" target="_blank">
                <img src={logo} width="100" height="100" alt="" />
              </a>
              <Link to="/" className="navbar-brand">Chunky- Learning Resource Tracker</Link>
              <div className="collpase navbar-collapse">
                <ul className="navbar-nav mr-auto">
                  <li className="navbar-item">
                    <Link to="/" className="nav-link">Topics</Link>
                  </li>
                  <li className="navbar-item">
                    <Link to="/create" className="nav-link">Create Topic</Link>
                  </li>
                </ul>
              </div>
            </nav> 

          <Route path="/" exact component={TopicList} />
          <Route path="/edit/:id" component={EditTopic} />
          <Route path="/create" component={CreateTopic} />
          </div>
      </Router>
    );
  }

}

export default App;
